import React from 'react';

class RecsList extends React.Component {
    constructor(props){
    super(props);
    }

    render() {
        return (
            <div>
            <OverlayTrigger
            rootClose
            trigger="click"
            data-trigger="focus"
            key="bottom"
            placement="bottom"
            overlay={
                <Popover id="popover-positioned-bottom">
                <Popover.Title as="h3">What about...</Popover.Title>
                <Popover.Content>This film</Popover.Content>
                </Popover>
            }
            >
            </OverlayTrigger>
            </div>
        )
    }
}




export default RecsList;
